,Easy,function isHappy(n) {
  const seen = new Set();
  while (n !== 1 && !seen.has(n)) {
    seen.add(n);
    let sum = 0;
    const numStr = n.toString();
    for (let i = 0; i < numStr.length; i++) {
      const digit = Number(numStr[i]);
      sum += digit * digit;
    }
    n = sum;
  }
  return n === 1;
